    def addBinary(self, a, b):
        """
        :type a: str
        :type b: str
        :rtype: str
        """

        if len(a) < len(b):
            a, b = b, a
        a, b = a[::-1], b[::-1]
        carry = 0
        res = []
        for i in range(len(a)):
            if i < len(b):
                if a[i] == '1':
                    carry += 1
                if b[i] == '1':
                    carry += 1
            if carry % 2 == 1:
                res.append('1')
            else:
                res.append('0')
            carry //= 2
        if carry == 1:
            res.append('1')
        return ''.join(res[::-1])

