class Solution(object):
    def simplifyPath(self, path):
        """
        :type path: str
        :rtype: str
        """

        # split the path into a list of directories
        dirs = path.split('/')

        # initialize a stack to store the directories
        stack = []

        # iterate over the directories in the list
        for dir in dirs:
            # if the directory is '..', pop the last directory from the stack
            if dir == '..':
                if stack:
                    stack.pop()
            # if the directory is not '..', add it to the stack
            elif dir and dir != '.':
                stack.append(dir)

        # join the stack with a '/' and return the result
        return '/' + '/'.join(stack)

